import React, { useEffect, useState } from 'react';
import axios from 'axios';

const StockPage = () => {
    const [products, setProducts] = useState([]);
    const [loading, setLoading] = useState(true);

    useEffect(() => {
        fetchProducts();
    }, []);

    const fetchProducts = async () => {
        setLoading(true);
        try {
            const { data } = await axios.get('/api/products');
            setProducts(data);
        } catch (e) {
            setProducts([]);
        } finally {
            setLoading(false);
        }
    };

    return (
        <div style={{ maxWidth: 1200, margin: '0 auto', padding: 32 }}>
            <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'center', marginBottom: 32 }}>
                <h1 style={{ color: '#1976d2', margin: 0 }}>Estoque de Produtos</h1>
                <button
                    style={{
                        background: '#1976d2', color: '#fff', border: 'none', borderRadius: 8, padding: '12px 24px', fontWeight: 600, fontSize: 16, cursor: 'pointer'
                    }}
                >
                    + Novo Produto
                </button>
            </div>
            <div style={{ background: '#fff', borderRadius: 12, boxShadow: '0 2px 8px #0001', overflow: 'hidden' }}>
                <div style={{ display: 'grid', gridTemplateColumns: '2fr 1fr 1fr 1fr 1fr 1fr 2fr', gap: 0, background: '#f5f5f5', fontWeight: 700, fontSize: 16, padding: 16 }}>
                    <div>Nome</div>
                    <div>Categoria</div>
                    <div>Unidade</div>
                    <div>Saldo</div>
                    <div>Estoque Mínimo</div>
                    <div>Status</div>
                    <div>Ações</div>
                </div>
                {loading ? (
                    <div style={{ padding: 40, textAlign: 'center', color: '#888' }}>Carregando...</div>
                ) : products.length === 0 ? (
                    <div style={{ padding: 40, textAlign: 'center', color: '#888' }}>Nenhum produto cadastrado.</div>
                ) : (
                    products.map(prod => (
                        <div key={prod.id} style={{
                            display: 'grid',
                            gridTemplateColumns: '2fr 1fr 1fr 1fr 1fr 1fr 2fr',
                            gap: 0,
                            alignItems: 'center',
                            padding: 16,
                            borderBottom: '1px solid #eee',
                            background: prod.stock <= prod.minStock ? '#fff8e1' : '#fff'
                        }}>
                            <div style={{ fontWeight: 600 }}>{prod.name}</div>
                            <div>{prod.category || '-'}</div>
                            <div>{prod.unit}</div>
                            <div style={{ fontWeight: 700, color: prod.stock <= prod.minStock ? '#f57c00' : '#388e3c' }}>
                                {prod.stock}
                            </div>
                            <div>{prod.minStock}</div>
                            <div style={{ fontWeight: 600, color: prod.stock <= prod.minStock ? '#f57c00' : '#388e3c' }}>
                                {prod.stock <= prod.minStock ? 'Baixo' : 'OK'}
                            </div>
                            <div style={{ display: 'flex', gap: 8 }}>
                                <button style={{ background: '#388e3c', color: '#fff', border: 'none', borderRadius: 6, padding: '6px 12px', cursor: 'pointer', fontWeight: 600 }}>Entrada</button>
                                <button style={{ background: '#f57c00', color: '#fff', border: 'none', borderRadius: 6, padding: '6px 12px', cursor: 'pointer', fontWeight: 600 }}>Saída</button>
                                <button style={{ background: '#1976d2', color: '#fff', border: 'none', borderRadius: 6, padding: '6px 12px', cursor: 'pointer', fontWeight: 600 }}>Histórico</button>
                                <button style={{ background: '#888', color: '#fff', border: 'none', borderRadius: 6, padding: '6px 12px', cursor: 'pointer', fontWeight: 600 }}>Editar</button>
                                <button style={{ background: '#ff6b6b', color: '#fff', border: 'none', borderRadius: 6, padding: '6px 12px', cursor: 'pointer', fontWeight: 600 }}>Excluir</button>
                            </div>
                        </div>
                    ))
                )}
            </div>
        </div>
    );
};

export default StockPage;
